import { useParams } from 'react-router-dom';
import { Slide } from 'react-slideshow-image';
import Api from './Api'


function Logement() {
    const data = Api();
    const idUrl = useParams();
    const loge = []
    data.forEach(function (res) {
        if (idUrl.id === res.id) {
            loge.push(res)
        }

    });
    console.log(loge)

    return (
        <div className='kasa-containere-slide'>
            <Slide>
            {loge.map((loge,id)=> (
                <div>
                <img src={loge.pictures} alt='' className='kasa-image-logement' />
                <img src={loge.pictures} alt='' className='kasa-image-logement' />
                <img src={loge.pictures} alt='' className='kasa-image-logement' />
                <img src={loge.pictures} alt='' className='kasa-image-logement' />
                <img src={loge.pictures} alt='' className='kasa-image-logement' />
                </div>
                ))}
            </Slide>
        </div>

    )

}

export default Logement
